style.css:
{"result":"@-moz-document url-prefix("https://rutor"), url-prefix("https://tracker.rutor") {
body {
	background-image: url(https://i.ibb.co/pj8qXsX/Blue-Plasma.gif), url(https://i.ibb.co/D5m7TVW/h-1523207183-7762604-160eb1d963.jpg);
    background-repeat: no-repeat;
    background-attachment:fixed;
    background-color: #000 !important;
    background-position: 100% 100%, center;
    background-size: 1280px, 100%;
    background-blend-mode: screen;
}
a, b, *, h1, h2, h3, h4, h5, h6, h1 *, h2 *, h3 *, strong, a:link, a:visited, a:active {
    color: #0099ff !important;
}
* {
    font-family: "Constantia"!important;
    font-style: italic;
    font-size: 14px;
}
@Keyframes look {
	0% {
	transform: rotate(5deg) scale(0);
	opacity: 0; }
    50% {
	transform: rotate(-5deg) scale(1);
    opacity: 1; }
	100% {
	transform: rotate(0deg); }
}
table, fieldset, div#ws div#sidebar div.sideblock, #download {
    -webkit-animation-name: look; 
    -webkit-animation-duration: 1s
}
@keyframes yadix {
	0% {box-shadow: 5px 5px 50px 10px #00beff; border-radius:50px 0px 50px 0; color: #075981;}
}
a:hover, input:hover, input[type="button"]:hover, select:hover, button:hover {
    color: #00ffff;
    text-shadow: 1px 1px #0099ff !important;
	animation: yadix 1s ease-in-out
}
img {
    box-shadow: 5px 5px 10px 1px #003366;
    border-radius:30px 0px 30px 0;
}
img:not(:hover) {
    transform: perspective(500px) rotateY(-10deg) rotateX(10deg);
    transition: 1s transform ease-in-out 
}
img { 
    transform: perspective(2000px) rotateY(0deg) rotateX(0deg);
    transition: 0.1s all ease-in-out;	
}
input *, input, select, .menu_b > div {
    color: #00ffff  !important
}
textarea, textarea * {
    color: #C8C8C8 !important; 
    text-shadow: 0 0 1px gray !important
}
body, html, div, h1, h2, h3, h4, h5, h6, table, tbody, thead, tr, td, th, ul, li, p, i, dd, dt, strong, code, iframe, embed, section, blockquote, label, form, pre, dl, img {
    color: #999 !important; 
    text-shadow: none !important; 
    background-color: transparent !important; 
    border-color: #006BB2 !important; 
}
.backgr > td > img { 
    height: 0px;width: 60px;
}
.logout > img {
    height: 24px;
} 
.downgif > img {
    height: 12px; width: 14px;visibility: hidden;
}
.downgif { 
    background-image:	url(data:image/png;base64,) !important;
        background-repeat: no-repeat;
}
table, fieldset, textarea, .hidebody, option {
    background: none repeat scroll 0 0 rgba(0, 7, 27, 0.5) !important;
	box-shadow: 10px 10px 7px 2px rgba(0, 0, 0, 5) !important;	
	border-radius:30px 0px 30px 0;
	-moz-border-radius: 5px !important;
	-khtml-border-radius: 5px !important;
}
::-webkit-scrollbar {
    background: -webkit-linear-gradient(40deg , #000000 , #002D45 , #000000 100%)!important;
    width: 5px !important;
}
::-webkit-scrollbar-thumb {
    background: -webkit-linear-gradient(10deg , #000000 , #0099ff , #000000 100%)!important;
    border-radius: 100px!important;
    border: 0px!important;
}
::-webkit-scrollbar-thumb:hover {
    cursor: pointer !important;
    background: -webkit-linear-gradient(10deg , #075981 , #0099ff , #075981 100%)!important;
    border: 1px solid #0099ff !important;
} 
@keyframes Logo {
    0% {transform: scalex(0)}
    25% {transform: scaleY(0.1)}
    50% {transform: scalex(0.7)}
    75% {transform: scaleY(0.15)}
}
#logo:hover, .menu_b > div:hover {
	animation-name: rubberBand;
    animation-duration: 1s;
    animation-delay: 3s;
}
#logo, .menu_b > div {
    animation-name: Logo;
    animation-duration: 0.8s;
}
#logo img {
    display: none;
}  
#logo {
    background-image:url(data:image/jpg;base64,) !important;
 height: 90px;width: 400px;
}
div#ws div#sidebar div.sideblock, fieldset, textarea, #logo {
    border:5px ridge  #006BB2 !important;
    border-radius:30px 0px 30px 0 !important;
}
div#MarketGid5190, div.sideblock2, iframe,noindex {
    display: none !important;
}
div#sidebar:after, div#down:after {
    content:"⚡️SamSony'a by AUDIMEN⚡️";
    color:#0099ff;
    box-shadow: 0 0 30px #009fff;
    border-radius:30px 0px 30px 0;
}
tr.backgr {      
	height: 20px !important;	
}
#menu, tr.backgr, .hidehead {
background: url('data:image/png;base64,') no-repeat !important;
    background-size: 100% !important;
    color: #00ffff !important; 
}
.menu_b > div, #download, select, input, button, #news_table {
    background: url('data:image/png;base64,') no-repeat !important; 
    background-size: cover !important;
    box-shadow: 10px 10px 7px 2px rgba(0, 0, 0, 5) !important;
    border: ridge 5px #006BB2;
    border-radius:30px 0px 30px 0 !important;
}
}"}
